// import Navbar from '../components/Navbar.js';

import { useState } from 'react';
import tile1 from '../resources/tile.jpg';

export default function Home(){
    
    const handleimgclick = (event) =>{
        window.scrollTo(1920,0);
    }

    const [mouseover1, setMouseover1] = useState(false);
    const [mouseover, setMouseover] = useState(false);

    return(
        <div className="home">
            {/* <Navbar/> */}
            <section className='home_one'>
                <div className='home_one_content'>
                    <h1>Aman</h1>
                    <h3>some text here</h3>
                    <img src='' alt='down arrow here' onClick={handleimgclick} />
                </div>
            </section>
            <section className={mouseover?'sec_2 opacity':'sec_2'}>
                <div className='sec2_title'>
                    <h1>PROJECTS</h1>
                </div>
                <div className='sec2_tiles row gx-0 gy-0'>
                    <div className='sec2_tile col-lg-6'>
                        <img src={tile1} alt='tile1' onMouseEnter={()=>{setMouseover1(true);setMouseover(true)}} onMouseLeave={()=>{setMouseover1(false);setMouseover(false)}} />
                    </div>
                    <div className='sec2_tile col-lg-6'>
                        <img src={tile1} alt='tile2'/>
                    </div>
                    <div className='sec2_tile col-lg-6'>
                        <img src={tile1} alt='tile3'/>
                    </div>
                    <div className='sec2_tile col-lg-6'>
                        <img src={tile1} alt='tile4'/>
                    </div>
                </div>
                <div className={(mouseover1)?'tile_descdiv on':'tile_descdiv off'}>
                    <h1>This is tile 1</h1>
                    <></><button>Submit</button>
                </div>
            </section>
            <section className='sec_3'>
                
            </section>
        </div>
    );
}
